import React from "react";
import {
	TextField,
	GridList,
	GridListTile,
	ListSubheader,
} from "@material-ui/core";

const HomePage = () => {
	return (
		<>
			<h1>Home Page</h1>
			<form>
				<TextField placeholder="Search recipes" variant="outlined" />
			</form>
			<GridList>
				<GridListTile cols={4}>
					<ListSubheader component="div">Recipes!</ListSubheader>
				</GridListTile>
			</GridList>
		</>
	);
};

export default HomePage;
